using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using ALICE_Ships_Datalink_Interface;
using ALICE_Command_Interface;
using ALICE_Internal;

namespace ALICE_Events
{
    public class Event_StoredModules : Event_Base
    {
        public Event_StoredModules()
        {
            Name = "StoredModules";
        }

        public void Logic()
        {
            if (Manager.WriteVariables && WriteVariables)
            {
                try
                {
                    Variables_Clear();
                    Variables_Generate();
                    Variables_Write();
                }
                catch (Exception ex)
                {
                    Internal.Exception(Name, "An Exception Occured While Updating Variables");
                    Internal.Exception(Name, "Exception: " + ex);
                }
            }

            //GameState.Logic_StoredModules((StoredModules)GetEvent());

            TriggerEvent();
        }

        public void Variables_Generate()
        {
            StoredModules Event = (StoredModules)Manager.GetEvent(Name);

            Variables.Clear();

            #region Custom Variables

            #endregion

            #region Event Variables
            Variable_Craft("MarketID", Event.MarketID.ToString());
            Variable_Craft("StationName", Event.StationName.ToString());
            Variable_Craft("StarSystem", Event.StarSystem.ToString());
            Variable_Craft("Items", Event.Items.ToString());
            #endregion
        }
    }

    #region StoredModules Event
    public class StoredModules : Base
    {
        public decimal MarketID { get; set; }
        public string StationName { get; set; }
        public string StarSystem { get; set; }
        public string Items { get; set; }
    }
    #endregion
}


